import React from 'react';
import './style.css';
import { Link } from 'react-router-dom';
import imgBrasilia from '../../Imagens/imgBrasilia.jpg'
import imgSaoPaulo from '../../Imagens/imgSaoPaulo.jpg'
import imgRioDeJaneiro from '../../Imagens/imgRioDeJaneiro.jpg'
import imgFortaleza from '../../Imagens/imgFortaleza.jpg'
import imgMaceio from '../../Imagens/imgMaceio.jpg'
import imgPernambuco from '../../Imagens/imgPernambuco.jpg'


const Promocoes = () => {
    return (
        <article>
            <p className='container page_body'>
            <h1>Promoções</h1>
                       
            <Link  to="/cadastrar"className='btn btn-light'>Cadastrar Cupom &raquo;</Link>
            
            <br/>
            
            <img src= {imgBrasilia} alt="Imagem" className="imgDF"/>
            <img src= {imgRioDeJaneiro} alt="Imagem" className="imgRJ"/>
            <img src= {imgSaoPaulo} alt="Imagem" className="imgSP"/>
            <img src= {imgFortaleza} alt="Imagem" className="imgCE"/>
            <img src= {imgMaceio} alt="Imagem" className="imgAL"/>
            <img src= {imgPernambuco} alt="Imagem" />
            
            
            </p>

                       

                    
        
        </article>
    );
}

export default Promocoes;
